  input: TEXT,F3XA,,"AMENDED REPORT --  On the original report $65,825.46 in Net Payroll
    expenditures and Payroll Tax payments were paid out of the Committee's Federal
    account and listed on Schedule H/4 as administrative expenses.  The expenditures
    were for the committee's staff's wages.  During the period 1-1-03 to 6-30-03 none
    of the committee's employees worked more than 25% of their time on Federal Election
    activities.  The Bipartisian Campaign Reform Act of 2002 prohibits a state committee
    from treating its staff wages as allocated expenses on Schedule H/4.  This amended
    report removes the expenditures from Schedule H/4 and reports the amounts on Schedule
    B, line 21b.   The Committee realizes these payments were in error.  Its non-federal
    account has not transfered funds to the Federal account for reimbursment of these
    expenditures.  Accordingly the committee's Federal Account will not transfer funds
    back to its non-federal account for this error.  As a result of the movement of
    the payroll expenses from Schedule H/4 to Schedule B the allocable administrative
    expense transfer listed on Schedule H/3 was overstated by $1,429, due to the 70
    day before and after window before and after the transfer.  To  correct this problem,
    the committee's Federal will transfer $1,500 to its non-federal account on 11-17-03.   "
